function setCookie(name, value, days) {
  var date = new Date();
  date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
  var expires = 'expires=' + date.toGMTString();
  document.cookie = name + '=' + value + '; ' + expires + '; path=/';
}

function setNewUserCookies() {
  // Set new_user cookie; expires in 1 day
  setCookie('new_user', 'true', 1);
  // Set existing_user cookie; expires in 1 year
  setCookie('existing_user', 'true', 365);
}

var newUser = false;

// If no existing_user cookie, they are new
if (document.cookie.indexOf('existing_user') === -1) {
  newUser = true;
  setNewUserCookies();
} else {
  // existing_user cookie is there, but check for 
  // 24-hour new_user cookie
  if (document.cookie.indexOf('new_user') !== -1) {
      newUser = true;
  }
}

// Set 'newuser' dimension to "true" or "false"
var value = 'false';
if (newUser) value = 'true';

// Push newuser dimension
window.optimizely.push(['setDimensionValue', 'newuser', value]);

/*
  TRAFFIC SOURCE TRACKING
  Set Optimizely dimension for Facebook, AdWords and YouTube visitors
*/

if (location.href.indexOf('utm_source=facebook') !== -1) {
  window.optimizely.push(['setDimensionValue', 'trafficsource', 'Facebook']);
} else if (location.href.indexOf('utm_source=adwords') !== -1) {
  window.optimizely.push(['setDimensionValue', 'trafficsource', 'AdWords']);
} else if (location.href.indexOf('utm_source=yt') !== -1) {
  window.optimizely.push(['setDimensionValue', 'trafficsource', 'YouTube']);
}

/*
  PAGE CATEGORY TRACKING
  On CLPs, set dimension based on category
*/

var category = $('meta[property="udemy_com:category"]').attr('content');
if (category) {
  window.optimizely.push(['setDimensionValue', 'clpcategory', category]);
}
